script: |
  super -f text -I q11036.spq | sort > q11036.out

inputs:
  - name: q11036.spq
    data: |
      SELECT 15 + + col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 + + 3 - col2 IN ( + 74, 32, + col2, - col2 * + - 96, col0, col1 * - col2, - col0, - col1 );
  - name: tab2

outputs:
  - name: q11036.out
    data: |
      61
      79
      90
